import {HStack} from "@chakra-ui/react";
import React, { useEffect, useState} from "react";
import axios from "axios";


import "./App.css"


function App(){

  
  const url = "http://localhost:8003/PerguntaSelecionadaPacientes";
  
  const [posts, setPosts] = useState([]);
  console.log(posts)

 
  useEffect(() => {
    axios.get(url)
      .then((response) => {
        setPosts(response.data);
      })
      .catch((error) => console.error(error));
  }, []);


  

  return(
    <div className="App" >  
    <div  className="Colum"> 
      <div className="cont">
          <center><h2  >Selecionar Pergunta</h2></center>
            <HStack spacing="8">
            <div>
    
                {posts.length > 0 ? (
                  <div>
                    {posts.map((post) => (
                      <div key={post.id}>
                        <p>{post.infoPaciente}</p>
                        <p>{post.selectedQuestions}</p>
                      </div>
                    ))}
                  </div>
                ) : (
                  <p>Nenhuma pergunta encontrada.</p>
                )}
              </div> 
            </HStack>
            </div>
          
      </div>
    </div>
  )
}

export default App
